// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./SahayogiToken.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";


contract FundRaising is AccessControl {

    using SafeMath for uint256;
    event Claim(
        uint256 id,
        uint256 projectId
    );
    event Create(
        uint256 id,
        uint256 projectId,
        string aidAgency,
        uint256 goal,
        uint32 startAt,
        uint32 endAt
    );
    event Cancel(uint256 id);
    event Donate(
        uint256 indexed id,
        address indexed donor,
        uint256 amount
    );
    event Refund(
        uint256 indexed id,
        address indexed donor,
        uint256 amount
    );
    struct RaiseFund {
        uint256 projectId;
        string aidAgency;
        //total tokens to be collected
        uint256 goal;
        uint256 donated;
        uint32 startAt;
        uint32 endAt;
        bool claimed;
        bool canceled;
    }

    //state
    SahayogiToken public erc20;
    //FRid=> RaiseFund
    uint256 public count;
    mapping(uint256 => RaiseFund) public raiseFunds;
    string[] raiseFundLists;
    // RFid=>userAdd=>amount
    mapping(uint256 => mapping(address => uint256)) public donatedAmount;

    constructor(SahayogiToken _erc20,address _admin) {
        _setupRole(DEFAULT_ADMIN_ROLE, _admin);
        erc20 = _erc20;

    }
    modifier OnlyAdmin() {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "SAHAYOGI:MUST BE ADMIN");
        _;
    }

    function createFundRaise(
        uint256 _projectId,
        string calldata _aidAgency,
        uint256 _goal,
        uint32 _startAt,
        uint32 _endAt
    ) public OnlyAdmin {
        require(_startAt >= block.timestamp, "SAHAYOGI: starting time is < now");
        require(_endAt >= _startAt, "SAHAYOGI: ending time  < starting time ");
        count +=1;

        raiseFunds[count] = RaiseFund({
            projectId:_projectId,
            aidAgency: _aidAgency, 
            goal: _goal,
            donated: 0,
            startAt: _startAt,
            endAt: _endAt,
            claimed: false,
            canceled: false
        });
        emit Create(count,_projectId,_aidAgency, _goal, _startAt, _endAt);

    }
    function getFrInfo(uint256 _id) public view returns(string memory AGENCY_,uint256 DONATED_,uint256 START_,uint256 END_,uint256 GOAL_){
    return(raiseFunds[_id].aidAgency,raiseFunds[_id].donated, raiseFunds[_id].startAt,raiseFunds[_id].endAt,raiseFunds[_id].goal);
    }

    function cancel(uint256 _id) public OnlyAdmin {
        RaiseFund memory raiseFund = raiseFunds[_id];
        require(
            block.timestamp < raiseFund.startAt,
            "SAHAYOGI: Fund raising already started cant be canceled"
        );
        delete raiseFunds[_id];
        emit Cancel(_id);
    }


    function donate(uint256 _id, uint256 _amount) external {
        RaiseFund storage raiseFund = raiseFunds[_id];
        require(block.timestamp >= raiseFund.startAt, "SAHAYOGI: Fund raising not started yet");
        require(block.timestamp <= raiseFund.endAt, "SAHAYOGI: Fund raising finished");

        raiseFund.donated += _amount;
        donatedAmount[_id][msg.sender] += _amount;
        erc20.transferFrom(msg.sender, address(this), _amount);

        emit Donate(_id, msg.sender, _amount);
    }
    function refund(uint _id) external{
        RaiseFund storage raiseFund = raiseFunds[_id];
        require(block.timestamp > raiseFund.endAt,"SAHAYOGI: Fund raising not ended");
        require(raiseFund.donated < raiseFund.goal,"SAHAYOGI: donated amount is less than goal");
        uint256 balance = donatedAmount[_id][msg.sender];
        donatedAmount[_id][msg.sender]=0;
        erc20.transfer(msg.sender,balance);
        emit Refund(_id,msg.sender,balance);

    }

    function claim(uint256 _id,uint256 _projectId) external {
        RaiseFund storage raiseFund = raiseFunds[_id];
        require(block.timestamp > raiseFund.endAt,"SAHAYOGI: Fund raising not ended");
        require(raiseFund.donated >= raiseFund.goal,"SAHAYOGI: hasnot reached goal");
        require(!raiseFund.claimed,"SAHAYOGI: Already claimed");
        raiseFund.claimed = true;
        erc20.transfer(msg.sender,raiseFund.donated);

        emit Claim(_id,_projectId);
    }
}
